import { Link } from "react-router-dom";

const Wheader = ({title}) => {


    return (
        <>
            <div className="wh">
                <h1 className="title">{title}</h1>
                <div className="gotohome"><Link to="/"></Link></div>
            </div>
        </>
    );
    
    }
    export default Wheader;
